import React from "react";

export const Headers = () => {
  return (
    <div className="m-10">
      <h1 className="font-size: inherit;">The logo</h1>
      <ul class="list-disc list-inside">
        <li>One</li>
        <li>Two</li>
        <li>Three</li>
      </ul>
    </div>
  );
};
